import './App.css';
// import App from './app/App';
import Login from '../pageComponents/Login';
import Start from '../pageComponents/Start';
import Setting from '../pageComponents/Setting';
import  Overview from '../pageComponents/Overview';
import InputSpend from '../pageComponents/InputSpent';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (

    <div className="App">
        <Routes>
            <Route path="/login" element={<Login />}/>
            <Route path="/start" element={<Start />}/>
            <Route path="/setting" element={<Setting />}/>
            <Route path="/overview" element={<Overview />}/>
            <Route path="/input_spent" element={<InputSpend />}/>
        </Routes>
    </div>

  );
}

export default App;
